<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>字符串排序</title>
</head>

<body>
    <script type="text/javascript">
        //  字符串排序
        //  对给定的由大小写字母混合构成的n个单词，输出按字典序从小到大排序后的结果
        void async function () {
            // Write your code here
            var first = await readline() // 去除first的情况
            var arr = []
            while (line = await readline()) {
                arr.push(line)
            }
            arr.sort().forEach(item => console.log(item))
        }()

        // 牛客 sort默认会按照ASCII字典序进行排序
        // 11
        // cap
        // to
        // cat
        // card
        // two
        // too
        // up
        // boat
        // boot
        // AA
        // Aa
    </script>
</body>

</html>
